/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `insert_student` BEFORE INSERT ON `students` FOR EACH ROW BEGIN
IF TIMESTAMPDIFF(YEAR, NEW.dateofbirthday, CURDATE()) < 13 OR TIMESTAMPDIFF(YEAR, NEW.dateofbirthday, CURDATE()) > 21 THEN SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Wiek osoby nie mieci si w dozwolonym zakresie!';
ELSEIF new.pesel < 1210100000 OR new.pesel >= 100000000000 THEN SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Podano nieprawidowy pesel!';
ELSEIF new.zip_code NOT LIKE '__-___' THEN SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Podano nieprawidowy format kodu pocztowego!';
END IF;
END */;;
